import React from "react";
import '../App.css'
import Profile from "../Profile.png"
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

const Home = () => (
  <div className="home">
        <h1>Home Page</h1>
        <img src={Profile}></img>
    </div>
   
)
    

export default Home;
